import React from 'react'
import MenuData from './MenuData';
import Card from './Card';
const Services = () => {
  return (
    <div className="services">
      <div className="service">
        <div>Services</div>
        {
          MenuData.map((val) => {
          return (
            <Card 
            img = {val.img}
            title= {val.title}
            price = {val.price}
            btn = {val.btn}
            />
          )
            
          })
        }
      </div>
    </div>
  )
}
export default Services;
